import React from 'react';
import { Link } from 'react-router-dom';

const Dashboard = () => (
  <div>
    <h1>Dashboard</h1>
    <p>Welcome to the Dashboard!</p>
    <Link to="/scan">
      <button>Go to QR Code Scanner</button>
    </Link>
  </div>
);

export default Dashboard;
